import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useToast } from './ToastProvider'; // Importăm hook-ul useToast
import '../styles/FormPage.css';

function Login({ setIsAuthenticated }) {
  const [formData, setFormData] = useState({
    email: '',
    password: '',
  });
  
  const [isLoading, setIsLoading] = useState(false);
  const navigate = useNavigate();
  const toast = useToast(); // Folosim hook-ul pentru toast-uri

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    
    // Validare simplă
    if (!formData.email || !formData.password) {
      toast.error('Te rugăm să completezi toate câmpurile.'); // Afișăm toast de eroare
      return;
    }
    
    setIsLoading(true);

    try {
      const response = await fetch('http://localhost:5000/api/users/login', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });

      const data = await response.json();

      if (data.success) {
        // Stocăm token-ul în localStorage
        localStorage.setItem('authToken', data.token);
        
        try {
          // Metoda simplă de extragere a userId din token
          const base64Url = data.token.split('.')[1];
          const base64 = base64Url.replace(/-/g, '+').replace(/_/g, '/');
          const jsonPayload = decodeURIComponent(atob(base64)
            .split('').map(c => '%' + ('00' + c.charCodeAt(0).toString(16)).slice(-2)).join(''));
          const decoded = JSON.parse(jsonPayload);
          
          console.log("Decoded token:", decoded);
          
          // Salvăm userId
          localStorage.setItem('userId', decoded.id || decoded.userId);
          console.log("Saved userId:", decoded.id || decoded.userId);
        } catch (err) {
          console.error("Error decoding token:", err);
          // Ca soluție de rezervă, vom face o cerere pentru a obține userId-ul
          await fetchUserProfile(data.token);
        }
        
        // Setăm starea de autentificare
        setIsAuthenticated(true);
        
        // Afișăm un toast de succes
        toast.success('Autentificare reușită! Bine ai venit!');
        
        // Redirecționăm utilizatorul către pagina principală
        navigate('/');
      } else {
        // Afișăm un toast de eroare cu mesajul de la server
        toast.error(data.message || 'Autentificare eșuată. Verifică email-ul și parola.');
      }
    } catch (error) {
      console.error('Error during login:', error);
      // Afișăm un toast de eroare pentru eroarea de rețea
      toast.error('Eroare de rețea. Te rugăm să încerci din nou.');
    } finally {
      setIsLoading(false);
    }
  };

  // Funcție de rezervă pentru obținerea profilului și userId-ului
  const fetchUserProfile = async (token) => {
    try {
      // Facem o cerere pentru a obține profilul utilizatorului
      const response = await fetch('http://localhost:5000/api/users/profile', {
        headers: {
          'Authorization': `Bearer ${token}`
        }
      });
      
      if (response.ok) {
        const userData = await response.json();
        localStorage.setItem('userId', userData.user._id);
        console.log("Fetched and saved userId:", userData.user._id);
      }
    } catch (err) {
      console.error("Error fetching user profile:", err);
      toast.warning('Autentificare reușită, dar există probleme la obținerea profilului.');
    }
  };

  return (
    <div className="form-container">
      <h1>Autentificare</h1>
      
      <form onSubmit={handleSubmit}>
        <div className="input-group">
          <label htmlFor="email">Email</label>
          <input
            type="email"
            id="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            required
          />
        </div>
        
        <div className="input-group">
          <label htmlFor="password">Parolă</label>
          <input
            type="password"
            id="password"
            name="password"
            value={formData.password}
            onChange={handleChange}
            required
          />
        </div>
        
        <button 
          type="submit" 
          className="submit-button"
          disabled={isLoading}
        >
          {isLoading ? 'Se procesează...' : 'Autentificare'}
        </button>
      </form>
      
      <div className="switch-page">
        Nu ai un cont? <Link to="/register">Înregistrează-te</Link>
      </div>
    </div>
  );
}

export default Login;
